import { Container, Table, Row } from 'react-bootstrap';

function ModeloTabela(props) {
    return (  

    <td>
                    {props.id_pedidos}
                    {props.data}
                    {props.nomeClientes}
                    {props.email}
                    {props.telefone}
                    {props.endereco}
                    {props.produto_id}
                    {props.quantidade}
                    {props.categoria}
                    {props.descrição}
                    {props.precoCheio}
                    {props.precoDesconto}            
    </td>         
        
    )
};

export default ModeloTabela;
